import Layout from '../common/Layout';
import axios from 'axios';
import { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
	faChair,
	faBed,
	faDesktop,
	faClothesHanger,
	faAirConditionar,
} from '@fortawesome/free-solid-svg-icons';

// key
// AIzaSyDv6JIUkmdFO-F6Ha1KriiO4uw0Iot8bb4

// palylist
// PLmAX7QJDEdu3phGnuvhY1SIPB47cipfvn

function Youtube() {
	const path = process.env.PUBLIC_URL;
	const desc =
		'Lorem ipsum dolor sit, amet consectetur adipisicing elit. Nulla iure nostrum quisquam minima dolores animi?';

	return (
		<>
			<Layout
				name='Youtube'
				desc={desc}
				visual={`${path}/img/sub/youtube/visual.jpg`}></Layout>

			<div id='youtube'>
				<ul>
					<li>
						<button>
							<FontAwesomeIcon icon={faChair}></FontAwesomeIcon>
						</button>
					</li>
					<li>
						<button>
							<FontAwesomeIcon icon={faBed}></FontAwesomeIcon>
						</button>
					</li>
					<li>
						<button>
							<FontAwesomeIcon icon={faDesktop}></FontAwesomeIcon>
						</button>
					</li>
					<li>
						<button>
							<FontAwesomeIcon icon={faDesktop}></FontAwesomeIcon>
						</button>
					</li>
					<li>
						<button>
							<FontAwesomeIcon icon={faAirConditionar}></FontAwesomeIcon>
						</button>
					</li>
				</ul>
			</div>
		</>
	);
}

export default Youtube;
